import React from "react";
import Products_Details from "./Products_Detail";
import "./Product.css";
const Products = [
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:image/jpeg;base64,",
    description: "soft white shirt",
    price: "500",
  },
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:data:image/png;base64,",
    description: "soft red shirt ",
    price: "500",
  },
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:image/jpeg;base64,",
    description: "mast hn bhai",
    price: "500",
  },
  {
    name: "T-shirt",
    title: "T-shirt",
    id: 1,
    img:
      "data:image/jpeg;base64,",
    description: "mast hn bhai",
    price: "500",
  },
];

function Product() {
  return (
    <>
      <div className="Product">
        {Products.map((product) => (
          <div className="product_y">
            <Products_Details product={product} />;
          </div>
        ))}
        ;
      </div>
    </>
  );
}
export default Product;
